references:
  - name: toolvault_status
    description: Getting ToolVault running port and status
    priorityLevel: 500
    text: >-
      ToolVault writes its API endpoint location to a platform-specific configuration file when the server starts. This file is deleted when the server shuts down, so its presence indicates the server is running.


      Configuration File Location by Platform:

      - macOS: ~/Library/Application Support/ToolVault/api.json

      - Linux: ~/.config/toolvault/api.json

      - Windows: %APPDATA%\ToolVault\api.json


      Configuration File Format:

      ```json

      {
        "apiPath": "http://localhost:3000"
      }

      ```

      The apiPath value contains the full base URL where the ToolVault HTTP API is accessible.


      Discovery Process:

      - Check if the configuration file exists at the platform-specific location.

      - If the file does not exist, the server is not running.

      - If the file exists, read and parse it as JSON.

      - Extract the apiPath property to get the server's base URL.


      Checking Server Status

      Once you have the server's base URL (the apiPath), you can check the MCP gateway (bridge) status.


      Status Endpoint: GET (apiPath)/api/v1/bridge/status


      Request: GET http://localhost:3000/api/v1/bridge/status


      Response Format:


      ```json

      {
        "status": true,
        "running": true,
        "configuration": { 
          "host": { "mode": "sse", "host": "localhost", "port": 3100 }, 
          "actualPort": 3100 
        }
      }

      ```


      Response Fields:

      - status.running (boolean): Whether the MCP bridge/gateway is currently running.

      - status.configuration.host.actualPort: Is the port the gateway is running on, if it is running.
    include: manual
